import './App.css';
import React, { Component } from 'react'
import Header from './Components/Header/Header';
import PromoCar from './Components/PromoCar/PromoCar';
import Social from './Components/Social/Social';
import Section1 from './Components/Section1/Section1';
import Section2 from './Components/Section2/Section2';
import PromoCard from './Components/PromoCar/PromoCard/PromoCard';
import axios from 'axios'

export default class App extends Component {

  state = {
  deli:'ddd'

}


async componentDidMount() {
  console.log('111');

  const res = await axios.get('https://promocode-carsharing.firebaseio.com/promo.json')
  this.setState({ deli: res.data.Deli })
  console.log(res.data,'33');


}

render() {
  return (
    <div className="App">
     <Header></Header>
     <Section1></Section1>
     <Section2></Section2>
     <PromoCard deli = {this.state.deli} > </PromoCard>
     <PromoCar></PromoCar>
     <Social></Social>

    </div>
  );
}

}
